import React from "react";


const Footer = () => {

    return (

        <footer id="Contact" class="bg-white py-8 text-center">
        <ul class="flex justify-center space-x-4 mb-4">
            <li><a href="#" class="text-gray-600 text-2xl hover:text-blue-500"><ion-icon name="logo-facebook"></ion-icon></a></li>
            <li><a href="#" class="text-gray-600 text-2xl hover:text-blue-500"><ion-icon name="logo-twitter"></ion-icon></a></li>
            <li><a href="#" class="text-gray-600 text-2xl hover:text-blue-500"><ion-icon name="logo-linkedin"></ion-icon></a></li>
            <li><a href="#" class="text-gray-600 text-2xl hover:text-blue-500"><ion-icon name="logo-instagram"></ion-icon></a></li>
        </ul>
        <ul class="flex justify-center space-x-6 mb-4">
            <li><a href="#" class="text-gray-600 text-lg hover:text-blue-500">Home</a></li>
            <li><a href="#" class="text-gray-600 text-lg hover:text-blue-500">About</a></li>
            <li><a href="#" class="text-gray-600 text-lg hover:text-blue-500">Services</a></li>
            <li><a href="#" class="text-gray-600 text-lg hover:text-blue-500">Team</a></li>
            <li><a href="#" class="text-gray-600 text-lg hover:text-blue-500">Contact</a></li>
        </ul>
        <p class="text-gray-600 text-sm">&copy;2024 Beautiify | All Rights Reserved</p>
    </footer>


    );
}

export default Footer;
